<?php

# @autogenerated
declare(strict_types=1);

use Civi\Lughauth\Features\Access\RelyingParty\Domain\ValueObject\RelyingPartyCodeVO;
use Civi\Lughauth\Features\Access\RelyingParty\Domain\ValueObject\RelyingPartyApiKeyVO;
use Civi\Lughauth\Features\Access\RelyingParty\Domain\ValueObject\RelyingPartyEnabledVO;
use Civi\Lughauth\Features\Access\RelyingParty\Domain\ValueObject\RelyingPartyVersionVO;
use Civi\Lughauth\Features\Access\RelyingParty\Application\Usecase\Enable\RelyingPartyEnableResult;
use PHPUnit\Framework\TestCase;

final class RelyingPartyEnableResultUnitTest extends TestCase
{
    public function test(): void
    {
        $value = new RelyingPartyEnableResult();
        $codeOneValue = 'one';
        $codeOtherValue = 'other';
        $copy = $value->code($codeOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals('one', $value->getCode());
        $this->assertNotEquals('other', $value->getCode());
        $this->assertEquals('one', $value->getCodeOrDefault(RelyingPartyCodeVO::from($codeOtherValue))->value());
        $this->assertNotEquals('other', $value->getCodeOrDefault(RelyingPartyCodeVO::from($codeOtherValue))->value());
        $value->unsetCode();
        $this->assertEquals('other', $value->getCodeOrDefault(RelyingPartyCodeVO::from($codeOtherValue))->value());
        $this->assertNotEquals('one', $value->getCodeOrDefault(RelyingPartyCodeVO::from($codeOtherValue))->value());
        $apiKeyOneValue = 'one';
        $apiKeyOtherValue = 'other';
        $copy = $value->apiKey($apiKeyOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals('one', $value->getApiKey());
        $this->assertNotEquals('other', $value->getApiKey());
        $this->assertEquals('one', $value->getApiKeyOrDefault(RelyingPartyApiKeyVO::from($apiKeyOtherValue))->value());
        $this->assertNotEquals('other', $value->getApiKeyOrDefault(RelyingPartyApiKeyVO::from($apiKeyOtherValue))->value());
        $value->unsetApiKey();
        $this->assertEquals('other', $value->getApiKeyOrDefault(RelyingPartyApiKeyVO::from($apiKeyOtherValue))->value());
        $this->assertNotEquals('one', $value->getApiKeyOrDefault(RelyingPartyApiKeyVO::from($apiKeyOtherValue))->value());
        $enabledOneValue = true;
        $enabledOtherValue = false;
        $copy = $value->enabled($enabledOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals(true, $value->getEnabled());
        $this->assertNotEquals(false, $value->getEnabled());
        $this->assertEquals(true, $value->getEnabledOrDefault(RelyingPartyEnabledVO::from($enabledOtherValue))->value());
        $this->assertNotEquals(false, $value->getEnabledOrDefault(RelyingPartyEnabledVO::from($enabledOtherValue))->value());
        $value->unsetEnabled();
        $this->assertEquals(false, $value->getEnabledOrDefault(RelyingPartyEnabledVO::from($enabledOtherValue))->value());
        $this->assertNotEquals(true, $value->getEnabledOrDefault(RelyingPartyEnabledVO::from($enabledOtherValue))->value());
        $versionOneValue = 1;
        $versionOtherValue = 2;
        $copy = $value->version($versionOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals(1, $value->getVersion());
        $this->assertNotEquals(2, $value->getVersion());
        $this->assertEquals(1, $value->getVersionOrDefault(RelyingPartyVersionVO::from($versionOtherValue))->value());
        $this->assertNotEquals(2, $value->getVersionOrDefault(RelyingPartyVersionVO::from($versionOtherValue))->value());
        $value->unsetVersion();
        $this->assertEquals(2, $value->getVersionOrDefault(RelyingPartyVersionVO::from($versionOtherValue))->value());
        $this->assertNotEquals(1, $value->getVersionOrDefault(RelyingPartyVersionVO::from($versionOtherValue))->value());
        $this->assertSame($value, $copy);
    }
}
